import React from 'react';
import Logo from '../../../utils/img/rsz_logo.jpg';
import { Menu, Container, Button, Label } from 'semantic-ui-react';

const TopNavbar = () => {
	return (
		<Menu borderless size='large' attached style={{ border: 'none' }}>
			<Container>
				<Menu.Item>
					<Button as='a' basic className='font'>
						عضویت
					</Button>
					<Button as='a' basic className='font' style={{ marginLeft: '0.5em', boxShadow: 'none' }}>
						<Label as='a' basic>
							2,048
						</Label>
					</Button>
				</Menu.Item>
			</Container>
		</Menu>
	);
};

export default TopNavbar;
